import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 50-73.69 Penalty for failure to timely pay annual registration fee.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.69.md","filePath":"vacode/50-73.69.md"}'),r={name:"vacode/50-73.69.md"},n=i('<h1 id="§-50-73-69-penalty-for-failure-to-timely-pay-annual-registration-fee" tabindex="-1">§ 50-73.69 Penalty for failure to timely pay annual registration fee. <a class="header-anchor" href="#§-50-73-69-penalty-for-failure-to-timely-pay-annual-registration-fee" aria-label="Permalink to &quot;§ 50-73.69 Penalty for failure to timely pay annual registration fee.&quot;">​</a></h1><p>A. Any domestic or any foreign limited partnership that fails to pay the annual registration fee into the state treasury within the time prescribed in § <a href="http://law.lis.virginia.gov/vacode/50-73.67/" target="_blank" rel="noreferrer">50-73.67</a> shall incur a penalty of $25, which shall be added to the amount of the annual registration fee due. The penalty prescribed herein shall be in addition to any other penalty or liability imposed by law.</p><p>B. The Commission shall mail to each domestic and foreign limited partnership that fails to pay the annual registration fee within the time prescribed in § <a href="http://law.lis.virginia.gov/vacode/50-73.67/" target="_blank" rel="noreferrer">50-73.67</a> notice of assessment of the penalty imposed herein and of the impending cancellation of its existence or certificate of registration, as the case may be. A domestic limited partnership whose certificate has been canceled pursuant to this section is dissolved upon cancellation and shall be wound up pursuant to Article 8 (§ <a href="http://law.lis.virginia.gov/vacode/50-73.49/" target="_blank" rel="noreferrer">50-73.49</a> et seq.) of this chapter.</p><p>1985, c. 607; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0255" target="_blank" rel="noreferrer">255</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0163" target="_blank" rel="noreferrer">163</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0052" target="_blank" rel="noreferrer">52</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0274" target="_blank" rel="noreferrer">274</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0601" target="_blank" rel="noreferrer">601</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0586" target="_blank" rel="noreferrer">586</a>.</p>',4),l=[n];function o(s,c,f,h,p,g){return a(),t("div",null,l)}const u=e(r,[["render",o]]);export{_ as __pageData,u as default};
